          <img
            className="workComponent"
            src={`/QyfMzqhCmt--${index}.png`}
            key={index}
          />
        ))}
      </Dump>
      <style jsx>{`
        .workComponent {
          max-width: 425px;
        }
      `}</style>
    </div>
  );
}
